options.rowCallback:
function(row, data, num, index){
  var $row = $(row);
    $row.css('background-color', '#454b51');
    $row.hover(function(){
      $(this).css('background-color', '#6a737c');
     }, function(){
      $(this).css('background-color', '#454b51');
     }
    );
}

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = true;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}

